import Link from "next/link";

export default function Nav() {
    return (
        <nav className="Nav">
            <Link href="/"><a>代办</a></Link>
            <Link href="/about"><a>待办板</a></Link>
            <Link href="/blank"><a>数据统计</a></Link>
            <Link href="/my"><a>我的</a></Link>
        </nav>
    )
}
